import React from 'react'
import Arrays from '../../data/featuredData'

export default function Featured() {
    let datas =Arrays()
  return (
    <div>

       {datas.map((item, index)=> {
        return(
            <li key={index}>
                <img src={item.img} alt="" />
                <h4>{item.name}</h4>
                <h5>{item.brand}</h5>
            </li>
        )
       })}

    </div>
  )
}
